func minDominoRotations(tops []int, bottoms []int) int {
	var f1, f2 = true, true
	var c1, c2, c3, c4 int
	domino := []int{tops[0], bottoms[0]}
	l := len(tops)
	result := l
	for i := 1; i < l; i++ {
		if f1 && domino[0] != tops[i] && domino[0] != bottoms[i] {
			f1 = false
		}
		if f2 && domino[1] != tops[i] && domino[1] != bottoms[i] {
			f2 = false
		}
		if f1 && domino[0] == bottoms[i] {
			if domino[0] != tops[i] {
				c1++
			} else {
				c3++
			}
		}
		if f2 && domino[1] == tops[i] {
			if domino[1] != bottoms[i] {
				c2++
			} else {
				c4++
			}
		}
		if !f1 && !f2 {
			return -1
		}
	}
	if f1 {
		if c1 > l-c3-c1 {
			result = l - c3 - c1
		} else {
			result = c1
		}
	}
	if f2 {
		if c2 > l-c4-c2 && result > l-c4-c2 {
			result = l - c4 - c2
		} else if result > c2 {
			result = c2
		}
	}

	return result
}

